import React from 'react';
function About() {
	return (
		<section>
			{/* Header of About Me section */}
			<div className="center" id="about">
				<h1 className="page-header">About Me</h1>
			</div>
			{/* My profile introduction here */}
			<div>
				<p>
				Thank you for visiting my portfolio. I am a Full Stack Developer based in Arlington, Virginia. While my work in tech focuses on the Front End, I do possess a good working knowledge of the Back End. Previously, I worked in International Security sector in the Washington, DC area and gained a solid experience in Project Management, which provides a unique perspective when working in development teams using Agile methodology. 
				I love solving problems, debugging, troubleshooting, designing and implementing solutions to complex issues.
				</p>
			</div>


			{/* My profile picture here */}
			<div className="center">
				<img
					src={require('../../assets/pictures/malick-ba.jpg')}
					alt="about-me"
					className="photo"
				/>
			</div>

			{/* <div>
				<img src="../../"
			</div> */}




		</section>
	);
}
export default About;
